        public static int LengthOfLongestSubstring(string s)
        {
            var examineLength = s.Length;

            while (examineLength > 0)
            {
                var subStrCount = s.Length - examineLength;

                for (var i = 0; i <= subStrCount; i++)
                {
                    var substr = s.Substring(i, examineLength);
                    if (!HasRepeatingCharacters(substr))
                    {
                        return substr.Length;
                    }
                }

                examineLength--;
            }

            return string.IsNullOrEmpty(s) ? 0 : 1;
        }

        private static bool HasRepeatingCharacters(string s)
        {
            var sArray = s.ToCharArray();
            return sArray.Any(c => sArray.Count(x => x == c) > 1);
        }
